import React from "react";
import "./LibraryBtn.css";

import SearchImage from '../../assets/pe.svg';

const LibraryBtn = () => {

  return <div className="libraryBtn">
    <div className="plusBtn">
        <img src={SearchImage}/>
    </div>
    <div className="nextbtn"></div>
  </div>
};


export default LibraryBtn;
